function Item({name:name=String,extend:extend={}}){this.id=`Item${"_"+Math.random().toString(36).substr(2,9)}`,this.created_at=Date.now(),this.name=name;var extendKeys=Object.keys(extend);if(0<extendKeys.length)for(let index=0;index<extendKeys.length;index++){var element=extendKeys[index];this[element]=extend[element]}return this}